    false,nt"url": null,nt"notes": "A "Threats and Conflicts" questionnaire
    completed by the Ottawa NWR staff in October 1981 identified threats and conflicts
    affecting refuge resources. These reports were summarized on a national basis in
    a 1983 report. Twenty-seven resource problems were identified at Ottawa NWR. Thirteen
    problems are of such a nature that either no action is possible or off refuge political
    solutions are needed. This plan identifies each problem, actions taken to date,
    and additional actions necessary to resolve or reduce each problem.",nt"license_title":
